void radioButtonField() {
  group('Radio button field', () {
    test('simple Radio button field creation', () {
      final PdfDocument document = PdfDocument();
      document.compressionLevel = PdfCompressionLevel.none;
      final PdfRadioButtonListField radioField =
          PdfRadioButtonListField(document.pages.add(), 'radio');
      document.form.fields.add(radioField);
      radioField.items.add(
          PdfRadioButtonListItem('1-1', const Rect.fromLTWH(100, 140, 20, 20)));
      radioField.items.add(
          PdfRadioButtonListItem('1-2', const Rect.fromLTWH(100, 170, 20, 20)));

      final List<int> bytes = document.saveSync();
      expect(bytes.isNotEmpty, true, reason: 'failed  to create radioButton');
      savePdf(bytes, 'FLUT_3412_radioButton1.pdf');
      document.dispose();
    });
  });
  group('Radio button field', () {
    test('Test cases 2', () {
      final PdfDocument document = PdfDocument();
      final PdfRadioButtonListField radioField =
          PdfRadioButtonListField(document.pages.add(), 'radio');
      document.form.fields.add(radioField);
      radioField.items.add(
          PdfRadioButtonListItem('a', const Rect.fromLTWH(100, 140, 20, 20)));
      radioField.items.add(
          PdfRadioButtonListItem('b', const Rect.fromLTWH(100, 170, 20, 20)));
      final PdfRadioButtonListItem btn3 =
          PdfRadioButtonListItem('c', const Rect.fromLTWH(100, 200, 20, 20));
      radioField.items.add(btn3);
      radioField.items.add(
          PdfRadioButtonListItem('d', const Rect.fromLTWH(100, 230, 20, 20)));
      radioField.items.add(
          PdfRadioButtonListItem('e', const Rect.fromLTWH(100, 260, 20, 20)));
      radioField.selectedIndex = 0;
      radioField.selectedIndex = 2;
      expect(radioField.selectedItem!.value, btn3.value,
          reason: 'Failed to get the selectedItem');
      expect(radioField.items.count, 5,
          reason: 'Failed to get the radio button Items');
      expect(radioField.selectedIndex, 2,
          reason: 'Failed to get the selected index');

      final List<int> bytes = document.saveSync();
      expect(bytes.isNotEmpty, true, reason: 'failed  to create radioButton');
      savePdf(bytes, 'FLUT_3412_radioButton2.pdf');
